import { BrowserRouter, Routes, Route } from "react-router-dom";
import Menu from "./components/Menu";
import Home from "./components/Guru"
import Poses from "./components/Poses";

function App() {
  return (
    <BrowserRouter>
      <Menu />

      <Routes>
        <Route path="/learn/asanas" element={<Poses />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
